{"query":"query GetUserFilterByRole($first: Int!, $offset: Int!, $role: UserRole!) {
  users(
    first: $first
    offset: $offset
    filter: {role: {equalTo: $role}}
    orderBy: CREATED_AT_ASC
  ) {
    nodes {
      id
      name
      email
      role
      type
      imageUrl
      seniority
      createdAt
      updatedAt
    }
  }
}

query GetFilteredUsers($first: Int!, $offset: Int!, $filterPayload: UserFilter) {
  users(
    first: $first
    offset: $offset
    filter: $filterPayload
    orderBy: CREATED_AT_ASC
  ) {
    nodes {
      id
      name
      email
      role
      type
      imageUrl
      seniority
      assignedWarehouse
      warehouseByAssignedWarehouse {
        id
        name
      }
      createdAt
      updatedAt
    }
    totalCount
  }
}

query GetOrderStats {
  Pending: orders(condition: {orderStatus: PENDING_APPROVAL}) {
    totalCount
  }
  Incoming: orders(condition: {orderStatus: INCOMING}) {
    totalCount
  }
  Incoming: orders(condition: {orderStatus: INCOMING}) {
    totalCount
  }
  Approved: orders(condition: {orderStatus: APPROVED}) {
    totalCount
  }
  Rejected: orders(condition: {orderStatus: REJECTED}) {
    totalCount
  }
  Completed: orders(condition: {orderStatus: COMPLETED}) {
    totalCount
  }
  Processing: orders(condition: {orderStatus: PROCESSING}) {
    totalCount
  }
}

query GetAllInboundOrders($first: Int!, $offset: Int!, $filterOrder: OrderFilter) {
  orders(first: $first, offset: $offset, filter: $filterOrder) {
    nodes {
      id
      waybillNumber
      manifestNumber
      orderType
      orderStatus
      metadata
      createdAt
      updatedAt
      customer: customerByCustomer {
        id
        name
        address
        address2
        city
        state
        postcode
        country
        phone
        email
        description
        metadata
        createdAt
        updatedAt
      }
      warehouse: warehouseByWarehouse {
        id
        name
        description
        organization
        address
        address2
        createdAt
        updatedAt
      }
      packingLists {
        nodes {
          id
          name
          description
          qtyPerCarton
          cartonSizeWidth
          cartonSizeHeight
          cartonWeight
          totalCartons
          createdAt
          updatedAt
        }
      }
    }
    totalCount
  }
}

query GetOrderByID($id: UUID!) {
  order(id: $id) {
    id
    waybillNumber
    manifestNumber
    orderType
    orderStatus
    metadata
    createdAt
    updatedAt
    customer: customerByCustomer {
      id
      name
      address
      address2
      city
      state
      postcode
      country
      phone
      email
      description
      metadata
      createdAt
      updatedAt
    }
    warehouse: warehouseByWarehouse {
      id
      name
      description
      organization
      address
      address2
      createdAt
      updatedAt
    }
    packingLists {
      nodes {
        id
        name
        description
        qtyPerCarton
        cartonSizeWidth
        cartonSizeHeight
        cartonWeight
        totalCartons
        createdAt
        updatedAt
      }
    }
    liveRoutes {
      nodes {
        id
        orderId
        templateRoute
        currentActivitiesByRouteId {
          nodes {
            activityId
            orderId
            routeId
          }
        }
        liveActivitiesByLiveRoute {
          nodes {
            id
            liveRoute
            templateActivity
            currentQtyScanned
            minQtyScanRequired
            totalItemCount
            activityStatus
            createdAt
          }
          totalCount
        }
      }
    }
  }
}

query GetAllCurrentActivities($first: Int!, $offset: Int!) {
  currentActivities(first: $first, offset: $offset) {
    nodes {
      order {
        id
        waybillNumber
        orderType
        metadata
        createdAt
        updatedAt
        customer
        warehouse
      }
      route {
        id
        orderId
        createdAt
        templateRoute
      }
      activity {
        id
        currentQtyScanned
        minQtyScanRequired
        activityStatus
        createdAt
        templateActivity
        liveRoute
      }
    }
    totalCount
  }
}

query GetAllCustomers($first: Int!, $offset: Int!, $filterPayload: CustomerFilter) {
  customers(first: $first, offset: $offset, filter: $filterPayload) {
    nodes {
      id
      name
      address
      address2
      city
      state
      postcode
        country
      phone
      email
      description
      metadata
      createdAt
      updatedAt
    }
    totalCount
  }
}

query GetFilteredWarehouses($first: Int!, $offset: Int!, $filterPayload: WarehouseFilter) {
  warehouses(first: $first, offset: $offset, filter: $filterPayload, orderBy: CREATED_AT_DESC) {
    nodes {
      id
      prefixId
      name
      description
      address
      address2
      city
      state
      postcode
      country
      createdAt
      updatedAt
      organization: organizationByOrganization {
        id
        name
        description
        createdAt
        updatedAt
      }
    }
    totalCount
  }
}

query GetFilteredSpaceInstances($first: Int!, $offset: Int!) {
  spaceInstances(first: $first, offset: $offset, filter: {
    type: {
      equalTo: "SHELVE"
    }
  }) {
    nodes {
      id
      name
      spaceId
      description
      code
      coordinates
      type: spaceTypeByType {
        id
        name
        createdAt
        updatedAt
      }
      warehouse: warehouseByWarehouse {
        id
        prefixId
        name
        description
        address
        address2
        city
        state
        postcode
        country
        createdAt
        updatedAt
      }
    }
    totalCount
  }
}
