{
  "swagger": "2.0",
  "info": {
    "title": "Pandaproxy API",
    "version": "0.0.1"
  },
  "host": "localhost:8082",
  "basePath": "/",
  "schemes": [
    "http"
  ],
  "paths": {"/brokers": {
        "get": {
          "summary": "Get a list of brokers.",
          "operationId": "get_brokers",
          "responses": {
            "200": {
              "description": "Array of topic names",
              "schema": {
                "type": "array",
                "items": {
                  "type": "integer"
                }
              }
            }
          }
        }
      },
      "/consumers/{group_name}": {
        "post": {
          "summary": "Create a consumer for the group",
          "operationId": "create_consumer",
          "consumes": ["application/vnd.kafka.v2+json"],
          "parameters": [
            {
              "name": "group_name",
              "in": "path",
              "required": true,
              "type": "string"
            },
            {
              "name": "properties",
              "in": "body",
              "schema": {
                "type": "object",
                "properties": {
                  "format": {
                    "type": "string",
                    "description": "oneOf: ['binary','json']"
                  },
                  "name": {
                    "type": "string",
                    "description": "Name of the consumer"
                  },
                  "auto.offset.reset": {
                    "type": "string",
                    "description": "oneOf: ['earliest']"
                  },
                  "auto.commit.enable": {
                    "type": "string",
                    "description": "oneOf: ['false']"
                  },
                  "fetch.min.bytes": {
                    "type": "string"
                  },
                  "consumer.request.timeout.ms": {
                    "type": "string"
                  }
                }
              }
            }
          ],
          "produces": ["application/vnd.kafka.v2+json"],
          "responses": {
            "200": {
              "description": "OK",
              "schema": {
                "type": "object",
                "properties": {
                  "instance_id": {
                    "type": "string"
                  },
                  "base_uri": {
                    "type": "string"
                  }
                }
              }
            },
            "409": {
              "description": "Consumer already exists",
              "schema": {
                "$ref": "#/definitions/error_body"
              }
            },
            "422": {
              "description": "Invalid configuration",
              "schema": {
                "$ref": "#/definitions/error_body"
              }
            }
          }
        }
      },
      "/consumers/{group_name}/instances/{instance}": {
        "delete": {
          "summary": "Remove a consumer for the group",
          "operationId": "remove_consumer",
          "consumes": ["application/vnd.kafka.v2+json"],
          "parameters": [
            {
              "name": "group_name",
              "in": "path",
              "required": true,
              "type": "string"
            },
            {
              "name": "instance",
              "in": "path",
              "required": true,
              "type": "string"
            }
          ],
          "produces": ["application/vnd.kafka.v2+json"],
          "responses": {
            "204": {
              "description": ""
            },
            "404": {
              "description": "Consumer not found",
              "schema": {
                "$ref": "#/definitions/error_body"
              }
            }
          }
        }
      },
      "/consumers/{group_name}/instances/{instance}/offsets": {
        "get": {
          "summary": "Get committed group offsets for given partitions",
          "operationId": "get_consumer_offsets",
          "consumes": ["application/vnd.kafka.v2+json"],
          "parameters": [
            {
              "name": "group_name",
              "in": "path",
              "required": true,
              "type": "string"
            },
            {
              "name": "instance",
              "in": "path",
              "required": true,
              "type": "string"
            },
            {
              "name": "offsets",
              "in": "body",
              "schema": {
                "type": "object",
                "properties": {
                  "partitions": {
                    "type": "array",
                    "items": {
                      "type": "object",
                      "properties": {
                        "topic": {
                          "type": "string"
                        },
                        "partition": {
                          "type": "integer"
                        }
                      }
                    }
                  }
                }
              }
            }
          ],
          "produces": ["application/vnd.kafka.v2+json"],
          "responses": {
            "200": {
              "description": "",
              "schema": {
                "type": "object",
                "properties": {
                  "offsets": {
                    "type": "array",
                    "items": {
                      "type": "object",
                      "properties": {
                        "topic": {
                          "type": "string"
                        },
                        "partition": {
